import React, { useEffect, useState } from 'react'

export default function PendingApproval() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8085/waste-details/orders")
      .then((res) => res.json())
      .then((val) => {
        const collectedRecords = val.filter((record) => record.status === "PENDING"||record.status === "ACCEPTED"||record.status === "NULL");
        setData(collectedRecords);
        console.log(collectedRecords);
      })
      .catch((err) => console.log("Unable to fetch", err));
  }, []);

  return (
    <>
      <h1 className='emph1'>Pickup Data</h1>
      <div className='backsize'>
        <table className="table">
          <thead>
            <tr>
              <th scope="col">No</th>
              <th scope="col">Farmer Name</th>
              <th scope="col">Email</th>
              <th scope="col">Mobile No</th>
              <th scope="col">Waste Type</th>
              <th scope="col">Address</th>
              <th scope="col">Status</th>
              <th scope="col">Date Of Pickup</th>
            </tr>
          </thead>
          <tbody>
            {data && data.length > 0 ? (
              data.map((val, index) => (
                <tr key={index}>
                  <th scope="row">{val.id}</th>
                  <td>{val.name}</td>
                  <td>{val.email}</td>
                  <td>{val.mobileNo}</td>
                  <td>{val.wasteType}</td>
                  <td>{val.address}</td>
                  <td>{val.status}</td>
                  <td>{val.pickupDate}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="7">No collected pickups found.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </>
  );
}
